// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title MultiSigWallet
 * @dev Multi-signature wallet for credential system treasury
 */
contract MultiSigWallet {
    // Owners
    mapping(address => bool) public isOwner;
    address[] public owners;
    
    // Transaction tracking
    struct Transaction {
        uint256 id;
        address to;
        uint256 value;
        bytes data;
        bool executed;
        uint256 confirmations;
        uint256 timestamp;
        string description;
    }
    
    mapping(uint256 => Transaction) public transactions;
    mapping(uint256 => mapping(address => bool)) public confirmations;
    mapping(address => uint256[]) public ownerTransactionIds;
    
    // Configuration
    uint256 public required;
    uint256 public transactionCount;
    uint256 public constant MAX_OWNERS = 50;
    uint256 public constant MAX_TRANSACTIONS = 1000;
    
    // Events
    event OwnerAdded(address indexed owner);
    event OwnerRemoved(address indexed owner);
    event TransactionSubmitted(uint256 indexed transactionId, address indexed submitter, address indexed to, uint256 value);
    event TransactionConfirmed(uint256 indexed transactionId, address indexed confirmer);
    event TransactionExecuted(uint256 indexed transactionId, address indexed executor);
    event TransactionRevoked(uint256 indexed transactionId, address indexed revoker);
    event RequirementChanged(uint256 oldRequired, uint256 newRequired);

    // Modifier
    modifier onlyOwner() {
        require(isOwner[msg.sender], "MultiSigWallet: not an owner");
        _;
    }

    modifier transactionExists(uint256 _transactionId) {
        require(transactions[_transactionId].id != 0 || _transactionId <= transactionCount, 
            "MultiSigWallet: transaction does not exist");
        _;
    }

    modifier notExecuted(uint256 _transactionId) {
        require(!transactions[_transactionId].executed, "MultiSigWallet: already executed");
        _;
    }

    constructor(address[] memory _owners, uint256 _required) {
        require(_owners.length > 0, "MultiSigWallet: owners required");
        require(_required > 0, "MultiSigWallet: required confirmations required");
        require(_owners.length >= _required, "MultiSigWallet: owners less than required");
        require(_owners.length <= MAX_OWNERS, "MultiSigWallet: max owners exceeded");

        for (uint256 i = 0; i < _owners.length; i++) {
            address owner = _owners[i];
            require(owner != address(0), "MultiSigWallet: invalid owner");
            require(!isOwner[owner], "MultiSigWallet: duplicate owner");
            
            isOwner[owner] = true;
            owners.push(owner);
        }
        
        required = _required;
    }

    // Submit transaction
    function submitTransaction(address _to, uint256 _value, bytes memory _data, string memory _description) 
        external onlyOwner returns (uint256) {
        require(transactionCount < MAX_TRANSACTIONS, "MultiSigWallet: max transactions reached");
        require(_to != address(0), "MultiSigWallet: invalid destination");
        
        uint256 transactionId = transactionCount + 1;
        
        transactions[transactionId] = Transaction({
            id: transactionId,
            to: _to,
            value: _value,
            data: _data,
            executed: false,
            confirmations: 0,
            timestamp: block.timestamp,
            description: _description
        });
        
        ownerTransactionIds[msg.sender].push(transactionId);
        transactionCount++;
        
        emit TransactionSubmitted(transactionId, msg.sender, _to, _value);
        
        return transactionId;
    }

    // Confirm transaction
    function confirmTransaction(uint256 _transactionId) 
        external onlyOwner transactionExists(_transactionId) notExecuted(_transactionId) {
        require(!confirmations[_transactionId][msg.sender], "MultiSigWallet: already confirmed");
        
        confirmations[_transactionId][msg.sender] = true;
        transactions[_transactionId].confirmations++;
        
        emit TransactionConfirmed(_transactionId, msg.sender);
        
        if (transactions[_transactionId].confirmations >= required) {
            executeTransaction(_transactionId);
        }
    }

    // Revoke confirmation
    function revokeConfirmation(uint256 _transactionId) 
        external onlyOwner transactionExists(_transactionId) notExecuted(_transactionId) {
        require(confirmations[_transactionId][msg.sender], "MultiSigWallet: not confirmed");
        
        confirmations[_transactionId][msg.sender] = false;
        transactions[_transactionId].confirmations--;
        
        emit TransactionRevoked(_transactionId, msg.sender);
    }

    // Execute transaction
    function executeTransaction(uint256 _transactionId) 
        public onlyOwner transactionExists(_transactionId) notExecuted(_transactionId) {
        Transaction storage transaction = transactions[_transactionId];
        
        require(transaction.confirmations >= required, "MultiSigWallet: not enough confirmations");
        
        transaction.executed = true;
        
        (bool success, ) = transaction.to.call{value: transaction.value}(transaction.data);
        require(success, "MultiSigWallet: execution failed");
        
        emit TransactionExecuted(_transactionId, msg.sender);
    }

    // Get transaction details
    function getTransaction(uint256 _transactionId) external view returns (
        address to,
        uint256 value,
        bytes memory data,
        bool executed,
        uint256 confirmations,
        uint256 timestamp,
        string memory description
    ) {
        Transaction storage transaction = transactions[_transactionId];
        return (
            transaction.to,
            transaction.value,
            transaction.data,
            transaction.executed,
            transaction.confirmations,
            transaction.timestamp,
            transaction.description
        );
    }

    // Get transaction confirmations
    function getTransactionConfirmations(uint256 _transactionId) external view returns (address[] memory) {
        address[] memory confirmers = new address[](owners.length);
        uint256 count = 0;
        
        for (uint256 i = 0; i < owners.length; i++) {
            if (confirmations[_transactionId][owners[i]]) {
                confirmers[count] = owners[i];
                count++;
            }
        }
        
        address[] memory result = new address[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = confirmers[i];
        }
        
        return result;
    }

    // Get owner count
    function getOwnerCount() external view returns (uint256) {
        return owners.length;
    }

    // Get owner transactions
    function getOwnerTransactions(address _owner) external view returns (uint256[] memory) {
        return ownerTransactionIds[_owner];
    }

    // Get pending transactions
    function getPendingTransactions() external view returns (uint256[] memory) {
        uint256[] memory pending = new uint256[](transactionCount);
        uint256 count = 0;
        
        for (uint256 i = 1; i <= transactionCount; i++) {
            if (!transactions[i].executed) {
                pending[count] = i;
                count++;
            }
        }
        
        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = pending[i];
        }
        
        return result;
    }

    // Get executed transactions
    function getExecutedTransactions() external view returns (uint256[] memory) {
        uint256[] memory executed = new uint256[](transactionCount);
        uint256 count = 0;
        
        for (uint256 i = 1; i <= transactionCount; i++) {
            if (transactions[i].executed) {
                executed[count] = i;
                count++;
            }
        }
        
        uint256[] memory result = new uint256[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = executed[i];
        }
        
        return result;
    }

    // Add owner
    function addOwner(address _owner) external {
        require(msg.sender == address(this), "MultiSigWallet: must be called via transaction");
        require(_owner != address(0), "MultiSigWallet: invalid owner");
        require(!isOwner[_owner], "MultiSigWallet: already owner");
        require(owners.length < MAX_OWNERS, "MultiSigWallet: max owners reached");
        
        isOwner[_owner] = true;
        owners.push(_owner);
        
        emit OwnerAdded(_owner);
    }

    // Remove owner
    function removeOwner(address _owner) external {
        require(msg.sender == address(this), "MultiSigWallet: must be called via transaction");
        require(isOwner[_owner], "MultiSigWallet: not an owner");
        require(owners.length - 1 >= required, "MultiSigWallet: cannot remove owner");
        
        isOwner[_owner] = false;
        
        for (uint256 i = 0; i < owners.length; i++) {
            if (owners[i] == _owner) {
                owners[i] = owners[owners.length - 1];
                owners.pop();
                break;
            }
        }
        
        emit OwnerRemoved(_owner);
    }

    // Change requirement
    function changeRequirement(uint256 _required) external {
        require(msg.sender == address(this), "MultiSigWallet: must be called via transaction");
        require(_required > 0, "MultiSigWallet: required must be > 0");
        require(_required <= owners.length, "MultiSigWallet: required > owners");
        
        uint256 oldRequired = required;
        required = _required;
        
        emit RequirementChanged(oldRequired, _required);
    }

    // Check if confirmed
    function isConfirmed(uint256 _transactionId, address _owner) external view returns (bool) {
        return confirmations[_transactionId][_owner];
    }

    // Get transaction count
    function getTransactionCount() external view returns (uint256) {
        return transactionCount;
    }

    // Receive ETH
    receive() external payable {}
}

contracts/OracleAggregator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title OracleAggregator
 * @dev Aggregates data from multiple oracle sources
 */
contract OracleAggregator {
    // Oracle data
    struct OracleData {
        address oracleAddress;
        string dataSource;
        uint256 timestamp;
        uint256 value;
        bool isActive;
        uint256 reliabilityScore;
    }
    
    // Data request
    struct DataRequest {
        bytes32 requestId;
        address requester;
        string dataType;
        uint256 timestamp;
        bool isFulfilled;
        uint256 aggregatedValue;
        uint256[] individualValues;
        address[] participatingOracles;
    }
    
    // Storage
    mapping(address => OracleData) public oracles;
    mapping(bytes32 => DataRequest) public dataRequests;
    mapping(address => bytes32[]) public oracleRequests;
    mapping(bytes32 => mapping(address => uint256)) public oracleResponses;
    mapping(string => address[]) public dataTypeOracles;
    
    // Configuration
    address public owner;
    uint256 public minOracleResponses = 3;
    uint256 public oracleCount;
    uint256 public requestCount;
    uint256 public constant MAX_ORACLES = 100;
    
    // Events
    event OracleRegistered(address indexed oracle, string dataSource);
    event OracleUpdated(address indexed oracle, string newDataSource);
    event OracleRemoved(address indexed oracle);
    event DataRequested(bytes32 indexed requestId, address indexed requester, string dataType);
    event DataFulfilled(bytes32 indexed requestId, uint256 aggregatedValue);
    event OracleResponseRecorded(bytes32 indexed requestId, address indexed oracle, uint256 value);

    // Modifier
    modifier onlyOwner() {
        require(msg.sender == owner, "OracleAggregator: caller is not owner");
        _;
    }

    modifier onlyRegisteredOracle() {
        require(oracles[msg.sender].isActive, "OracleAggregator: not a registered oracle");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    // Register oracle
    function registerOracle(address _oracle, string memory _dataSource) 
        external onlyOwner {
        require(_oracle != address(0), "OracleAggregator: invalid oracle address");
        require(!oracles[_oracle].isActive, "OracleAggregator: oracle already registered");
        require(oracleCount < MAX_ORACLES, "OracleAggregator: max oracles reached");
        
        oracles[_oracle] = OracleData({
            oracleAddress: _oracle,
            dataSource: _dataSource,
            timestamp: block.timestamp,
            value: 0,
            isActive: true,
            reliabilityScore: 100
        });
        
        oracleCount++;
        
        emit OracleRegistered(_oracle, _dataSource);
    }

    // Update oracle
    function updateOracle(address _oracle, string memory _newDataSource) 
        external onlyOwner {
        require(oracles[_oracle].isActive, "OracleAggregator: oracle not registered");
        
        oracles[_oracle].dataSource = _newDataSource;
        oracles[_oracle].timestamp = block.timestamp;
        
        emit OracleUpdated(_oracle, _newDataSource);
    }

    // Remove oracle
    function removeOracle(address _oracle) external onlyOwner {
        require(oracles[_oracle].isActive, "OracleAggregator: oracle not registered");
        
        oracles[_oracle].isActive = false;
        oracleCount--;
        
        emit OracleRemoved(_oracle);
    }

    // Request data
    function requestData(string memory _dataType) external returns (bytes32) {
        require(oracleCount >= minOracleResponses, "OracleAggregator: not enough oracles");
        
        bytes32 requestId = keccak256(abi.encodePacked(
            msg.sender,
            _dataType,
            block.timestamp
        ));
        
        dataRequests[requestId] = DataRequest({
            requestId: requestId,
            requester: msg.sender,
            dataType: _dataType,
            timestamp: block.timestamp,
            isFulfilled: false,
            aggregatedValue: 0,
            individualValues: new uint256[](0),
            participatingOracles: new address[](0)
        });
        
        requestCount++;
        
        emit DataRequested(requestId, msg.sender, _dataType);
        
        return requestId;
    }

    // Submit oracle response
    function submitResponse(bytes32 _requestId, uint256 _value) 
        external onlyRegisteredOracle {
        require(dataRequests[_requestId].timestamp != 0, "OracleAggregator: request not found");
        require(!dataRequests[_requestId].isFulfilled, "OracleAggregator: already fulfilled");
        
        oracleResponses[_requestId][msg.sender] = _value;
        
        address[] storage participating = dataRequests[_requestId].participatingOracles;
        participating.push(msg.sender);
        
        uint256[] storage values = dataRequests[_requestId].individualValues;
        values.push(_value);
        
        // Update oracle reliability
        _updateOracleReliability(msg.sender, true);
        
        emit OracleResponseRecorded(_requestId, msg.sender, _value);
        
        // Check if we have enough responses
        if (participating.length >= minOracleResponses) {
            _fulfillRequest(_requestId);
        }
    }

    // Fulfill request
    function _fulfillRequest(bytes32 _requestId) internal {
        DataRequest storage request = dataRequests[_requestId];
        
        uint256[] storage values = request.individualValues;
        uint256 result = _aggregateValues(values);
        
        request.aggregatedValue = result;
        request.isFulfilled = true;
        
        emit DataFulfilled(_requestId, result);
    }

    // Aggregate values using median
    function _aggregateValues(uint256[] memory _values) internal pure returns (uint256) {
        if (_values.length == 0) return 0;
        if (_values.length == 1) return _values[0];
        
        // Sort values
        uint256[] memory sorted = _sortValues(_values);
        
        // Return median
        if (sorted.length % 2 == 0) {
            return (sorted[sorted.length / 2 - 1] + sorted[sorted.length / 2]) / 2;
        } else {
            return sorted[sorted.length / 2];
        }
    }

    // Sort values
    function _sortValues(uint256[] memory _values) internal pure returns (uint256[] memory) {
        for (uint256 i = 0; i < _values.length; i++) {
            for (uint256 j = i + 1; j < _values.length; j++) {
                if (_values[i] > _values[j]) {
                    uint256 temp = _values[i];
                    _values[i] = _values[j];
                    _values[j] = temp;
                }
            }
        }
        return _values;
    }

    // Update oracle reliability
    function _updateOracleReliability(address _oracle, bool _success) internal {
        if (_success) {
            if (oracles[_oracle].reliabilityScore < 100) {
                oracles[_oracle].reliabilityScore += 1;
            }
        } else {
            if (oracles[_oracle].reliabilityScore > 0) {
                oracles[_oracle].reliabilityScore -= 5;
            }
        }
        oracles[_oracle].timestamp = block.timestamp;
    }

    // Get oracle data
    function getOracle(address _oracle) external view returns (OracleData memory) {
        return oracles[_oracle];
    }

    // Get request details
    function getRequest(bytes32 _requestId) external view returns (DataRequest memory) {
        return dataRequests[_requestId];
    }

    // Get aggregated value
    function getAggregatedValue(bytes32 _requestId) external view returns (uint256) {
        require(dataRequests[_requestId].isFulfilled, "OracleAggregator: not fulfilled");
        return dataRequests[_requestId].aggregatedValue;
    }

    // Get oracle response
    function getOracleResponse(bytes32 _requestId, address _oracle) 
        external view returns (uint256) {
        return oracleResponses[_requestId][_oracle];
    }

    // Get oracle count
    function getOracleCount() external view returns (uint256) {
        return oracleCount;
    }

    // Get request count
    function getRequestCount() external view returns (uint256) {
        return requestCount;
    }

    // Set minimum responses required
    function setMinOracleResponses(uint256 _minResponses) external onlyOwner {
        require(_minResponses > 0, "OracleAggregator: invalid min responses");
        require(_minResponses <= oracleCount, "OracleAggregator: exceeds oracle count");
        
        minOracleResponses = _minResponses;
    }

    // Get average value
    function getAverageValue(bytes32 _requestId) external view returns (uint256) {
        DataRequest storage request = dataRequests[_requestId];
        
        if (request.individualValues.length == 0) return 0;
        
        uint256 sum = 0;
        for (uint256 i = 0; i < request.individualValues.length; i++) {
            sum += request.individualValues[i];
        }
        
        return sum / request.individualValues.length;
    }

    // Get max value
    function getMaxValue(bytes32 _requestId) external view returns (uint256) {
        uint256[] memory values = dataRequests[_requestId].individualValues;
        
        if (values.length == 0) return 0;
        
        uint256 maxVal = values[0];
        for (uint256 i = 1; i < values.length; i++) {
            if (values[i] > maxVal) {
                maxVal = values[i];
            }
        }
        
        return maxVal;
    }

    // Get min value
    function getMinValue(bytes32 _requestId) external view returns (uint256) {
        uint256[] memory values = dataRequests[_requestId].individualValues;
        
        if (values.length == 0) return 0;
        
        uint256 minVal = values[0];
        for (uint256 i = 1; i < values.length; i++) {
            if (values[i] < minVal) {
                minVal = values[i];
            }
        }
        
        return minVal;
    }

    // Check if request is fulfilled
    function isRequestFulfilled(bytes32 _requestId) external view returns (bool) {
        return dataRequests[_requestId].isFulfilled;
    }

    // Get response count
    function getResponseCount(bytes32 _requestId) external view returns (uint256) {
        return dataRequests[_requestId].individualValues.length;
    }

    // Manual fulfill (emergency)
    function manualFulfill(bytes32 _requestId, uint256 _value) external onlyOwner {
        DataRequest storage request = dataRequests[_requestId];
        
        require(!request.isFulfilled, "OracleAggregator: already fulfilled");
        
        request.aggregatedValue = _value;
        request.isFulfilled = true;
        
        emit DataFulfilled(_requestId, _value);
    }

    // Transfer ownership
    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "OracleAggregator: invalid owner");
        owner = newOwner;
    }
}

contracts/PaymentProcessor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title PaymentProcessor
 * @dev Advanced payment processing for credential services
 */
contract PaymentProcessor {
    // Payment struct
    struct Payment {
        uint256 id;
        address sender;
        address recipient;
        uint256 amount;
        uint256 fee;
        uint256 timestamp;
        bool isProcessed;
        bool isRefunded;
        string paymentReference;
        bytes32 paymentType;
    }
    
    // Subscription
    struct Subscription {
        address subscriber;
        uint256 planId;
        uint256 startTime;
        uint256 nextPaymentTime;
        uint256 totalPaid;
        bool isActive;
        bool isCancelled;
    }
    
    // Plan
    struct Plan {
        uint256 id;
        string name;
        uint256 price;
        uint256 duration;
        uint256 maxTransactions;
        uint256 features;
        bool isActive;
    }
    
    // Storage
    mapping(uint256 => Payment) public payments;
    mapping(address => uint256[]) public userPayments;
    mapping(address => mapping(uint256 => Subscription)) public subscriptions;
    mapping(address => uint256[]) public userSubscriptions;
    mapping(uint256 => Plan) public plans;
    mapping(address => mapping(address => bool)) public allowedTokens;
    mapping(address => uint256) public tokenPrices;
    
    // State
    address public owner;
    uint256 public paymentCount;
    uint256 public planCount;
    uint256 public platformFeePercent = 25;
    uint256 public constant FEE_DENOMINATOR = 1000;
    uint256 public totalVolume;
    uint256 public totalFees;
    
    // Events
    event PaymentProcessed(uint256 indexed paymentId, address indexed sender, address indexed recipient, uint256 amount);
    event PaymentRefunded(uint256 indexed paymentId);
    event SubscriptionCreated(address indexed subscriber, uint256 planId, uint256 startTime);
    event SubscriptionCancelled(address indexed subscriber, uint256 planId);
    event SubscriptionRenewed(address indexed subscriber, uint256 planId);
    event PlanCreated(uint256 indexed planId, string name, uint256 price);
    event PlanUpdated(uint256 indexed planId, bool isActive);
    event TokenAllowed(address indexed token, uint256 price);
    event TokenDisallowed(address indexed token);
    event FeeUpdated(uint256 oldFee, uint256 newFee);

    // Modifier
    modifier onlyOwner() {
        require(msg.sender == owner, "PaymentProcessor: caller is not owner");
        _;
    }

    constructor() {
        owner = msg.sender;
        
        // Create default plans
        _createPlan("Basic", 0.01 ether, 30 days, 100, 1);
        _createPlan("Professional", 0.05 ether, 30 days, 1000, 3);
        _createPlan("Enterprise", 0.1 ether, 30 days, 10000, 7);
    }

    // Create payment
    function createPayment(
        address _recipient,
        string memory _reference
    ) external payable returns (uint256) {
        require(msg.value > 0, "PaymentProcessor: invalid amount");
        require(_recipient != address(0), "PaymentProcessor: invalid recipient");
        
        uint256 paymentId = ++paymentCount;
        
        uint256 fee = (msg.value * platformFeePercent) / FEE_DENOMINATOR;
        uint256 netAmount = msg.value - fee;
        
        payments[paymentId] = Payment({
            id: paymentId,
            sender: msg.sender,
            recipient: _recipient,
            amount: netAmount,
            fee: fee,
            timestamp: block.timestamp,
            isProcessed: false,
            isRefunded: false,
            paymentReference: _reference,
            paymentType: keccak256(abi.encodePacked(_reference))
        });
        
        userPayments[msg.sender].push(paymentId);
        userPayments[_recipient].push(paymentId);
        
        totalVolume += msg.value;
        totalFees += fee;
        
        // Transfer to recipient
        payable(_recipient).transfer(netAmount);
        
        emit PaymentProcessed(paymentId, msg.sender, _recipient, netAmount);
        
        return paymentId;
    }

    // Process payment
    function processPayment(uint256 _paymentId) external {
        Payment storage payment = payments[_paymentId];
        
        require(payment.id == _paymentId, "PaymentProcessor: payment not found");
        require(!payment.isProcessed, "PaymentProcessor: already processed");
        
        payment.isProcessed = true;
        
        emit PaymentProcessed(_paymentId, payment.sender, payment.recipient, payment.amount);
    }

    // Refund payment
    function refundPayment(uint256 _paymentId) external {
        Payment storage payment = payments[_paymentId];
        
        require(payment.id == _paymentId, "PaymentProcessor: payment not found");
        require(!payment.isRefunded, "PaymentProcessor: already refunded");
        require(payment.sender == msg.sender || msg.sender == owner, 
            "PaymentProcessor: not authorized");
        
        payment.isRefunded = true;
        
        payable(payment.sender).transfer(payment.amount);
        
        emit PaymentRefunded(_paymentId);
    }

    // Create subscription
    function createSubscription(uint256 _planId) external payable returns (uint256) {
        Plan storage plan = plans[_planId];
        
        require(plan.isActive, "PaymentProcessor: plan not active");
        require(msg.value >= plan.price, "PaymentProcessor: insufficient payment");
        
        uint256 subscriptionId = uint256(
            keccak256(abi.encodePacked(msg.sender, _planId, block.timestamp))
        );
        
        subscriptions[msg.sender][subscriptionId] = Subscription({
            subscriber: msg.sender,
            planId: _planId,
            startTime: block.timestamp,
            nextPaymentTime: block.timestamp + plan.duration,
            totalPaid: msg.value,
            isActive: true,
            isCancelled: false
        });
        
        userSubscriptions[msg.sender].push(subscriptionId);
        
        emit SubscriptionCreated(msg.sender, _planId, block.timestamp);
        
        return subscriptionId;
    }

    // Cancel subscription
    function cancelSubscription(uint256 _subscriptionId) external {
        Subscription storage sub = subscriptions[msg.sender][_subscriptionId];
        
        require(sub.subscriber == msg.sender, "PaymentProcessor: not subscriber");
        require(!sub.isCancelled, "PaymentProcessor: already cancelled");
        
        sub.isCancelled = true;
        sub.isActive = false;
        
        emit SubscriptionCancelled(msg.sender, sub.planId);
    }

    // Renew subscription
    function renewSubscription(uint256 _subscriptionId) external payable {
        Subscription storage sub = subscriptions[msg.sender][_subscriptionId];
        
        require(sub.subscriber == msg.sender, "PaymentProcessor: not subscriber");
        require(!sub.isCancelled, "PaymentProcessor: subscription cancelled");
        
        Plan storage plan = plans[sub.planId];
        require(msg.value >= plan.price, "PaymentProcessor: insufficient payment");
        
        sub.nextPaymentTime = block.timestamp + plan.duration;
        sub.totalPaid += msg.value;
        sub.isActive = true;
        
        emit SubscriptionRenewed(msg.sender, sub.planId);
    }

    // Create plan
    function _createPlan(
        string memory _name,
        uint256 _price,
        uint256 _duration,
        uint256 _maxTransactions,
        uint256 _features
    ) internal {
        uint256 planId = planCount++;
        
        plans[planId] = Plan({
            id: planId,
            name: _name,
            price: _price,
            duration: _duration,
            maxTransactions: _maxTransactions,
            features: _features,
            isActive: true
        });
        
        emit PlanCreated(planId, _name, _price);
    }

    // Create plan (public)
    function createPlan(
        string memory _name,
        uint256 _price,
        uint256 _duration,
        uint256 _maxTransactions,
        uint256 _features
    ) external onlyOwner {
        _createPlan(_name, _price, _duration, _maxTransactions, _features);
    }

    // Update plan
    function updatePlan(uint256 _planId, bool _isActive) external onlyOwner {
        require(plans[_planId].id == _planId, "PaymentProcessor: plan not found");
        
        plans[_planId].isActive = _isActive;
        
        emit PlanUpdated(_planId, _isActive);
    }

    // Allow token
    function allowToken(address _token, uint256 _price) external onlyOwner {
        require(_token != address(0), "PaymentProcessor: invalid token");
        
        allowedTokens[_token][address(this)] = true;
        tokenPrices[_token] = _price;
        
        emit TokenAllowed(_token, _price);
    }

    // Disallow token
    function disallowToken(address _token) external onlyOwner {
        allowedTokens[_token][address(this)] = false;
        
        emit TokenDisallowed(_token);
    }

    // Update fee
    function updatePlatformFee(uint256 _newFee) external onlyOwner {
        require(_newFee <= 100, "PaymentProcessor: fee too high");
        
        uint256 oldFee = platformFeePercent;
        platformFeePercent = _newFee;
        
        emit FeeUpdated(oldFee, _newFee);
    }

    // Get payment
    function getPayment(uint256 _paymentId) external view returns (Payment memory) {
        return payments[_paymentId];
    }

    // Get plan
    function getPlan(uint256 _planId) external view returns (Plan memory) {
        return plans[_planId];
    }

    // Get subscription
    function getSubscription(address _user, uint256 _subscriptionId) 
        external view returns (Subscription memory) {
        return subscriptions[_user][_subscriptionId];
    }

    // Get user payments
    function getUserPayments(address _user) external view returns (Payment[] memory) {
        uint256[] storage paymentIds = userPayments[_user];
        Payment[] memory result = new Payment[](paymentIds.length);
        
        for (uint256 i = 0; i < paymentIds.length; i++) {
            result[i] = payments[paymentIds[i]];
        }
        
        return result;
    }

    // Get user subscriptions
    function getUserSubscriptions(address _user) 
        external view returns (Subscription[] memory) {
        uint256[] storage subIds = userSubscriptions[_user];
        Subscription[] memory result = new Subscription[](subIds.length);
        
        for (uint256 i = 0; i < subIds.length; i++) {
            result[i] = subscriptions[_user][subIds[i]];
        }
        
        return result;
    }

    // Get statistics
    function getStatistics() external view returns (
        uint256 totalPay,
        uint256 totalVol,
        uint256 totalFee,
        uint256 planCnt
    ) {
        return (paymentCount, totalVolume, totalFees, planCount);
    }

    // Calculate subscription cost
    function calculateSubscriptionCost(uint256 _planId, uint256 _months) 
        external view returns (uint256) {
        Plan storage plan = plans[_planId];
        return plan.price * _months;
    }

    // Check if subscription active
    function isSubscriptionActive(address _user, uint256 _subscriptionId) 
        external view returns (bool) {
        Subscription storage sub = subscriptions[_user][_subscriptionId];
        return sub.isActive && !sub.isCancelled && sub.nextPaymentTime > block.timestamp;
    }

    // Get payment count
    function getPaymentCount() external view returns (uint256) {
        return paymentCount;
    }

    // Get plan count
    function getPlanCount() external view returns (uint256) {
        return planCount;
    }

    // Receive payments
    receive() external payable {}
}

contracts/RateLimiter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/**
 * @title RateLimiter
 * @dev Rate limiting for contract operations
 */
contract RateLimiter {
    // Rate limit configuration
    struct RateLimitConfig {
        uint256 maxRequests;
        uint256 timeWindow;
        uint256 currentRequests;
        uint256 windowStart;
        bool isActive;
    }
    
    // Storage
    mapping(address => RateLimitConfig) public userLimits;
    mapping(address => mapping(uint256 => uint256)) public userRequestTimestamps;
    mapping(address => uint256) public userRequestCounts;
    
    // Global config
    address public admin;
    uint256 public globalMaxRequests;
    uint256 public globalTimeWindow;
    uint256 public globalCurrentRequests;
    uint256 public globalWindowStart;
    
    // Events
    event RateLimitSet(address indexed user, uint256 maxRequests, uint256 timeWindow);
    event RequestAllowed(address indexed user, uint256 currentCount);
    event RequestBlocked(address indexed user, uint256 currentCount, string reason);
    event GlobalLimitUpdated(uint256 maxRequests, uint256 timeWindow);
    event UserWhitelisted(address indexed user);
    event UserBlacklisted(address indexed user);

    // Modifier
    modifier onlyAdmin() {
        require(msg.sender == admin, "RateLimiter: caller is not admin");
        _;
    }

    constructor(uint256 _globalMaxRequests, uint256 _globalTimeWindow) {
        require(_globalMaxRequests > 0, "RateLimiter: invalid max requests");
        require(_globalTimeWindow > 0, "RateLimiter: invalid time window");
        
        admin = msg.sender;
        globalMaxRequests = _globalMaxRequests;
        globalTimeWindow = _globalTimeWindow;
        globalWindowStart = block.timestamp;
    }

    // Set user rate limit
    function setUserRateLimit(address _user, uint256 _maxRequests, uint256 _timeWindow) 
        external onlyAdmin {
        require(_user != address(0), "RateLimiter: invalid user");
        require(_maxRequests > 0, "RateLimiter: invalid max requests");
        require(_timeWindow > 0, "RateLimiter: invalid time window");
        
        userLimits[_user] = RateLimitConfig({
            maxRequests: _maxRequests,
            timeWindow: _timeWindow,
            currentRequests: 0,
            windowStart: block.timestamp,
            isActive: true
        });
        
        emit RateLimitSet(_user, _maxRequests, _timeWindow);
    }

    // Check and record request
    function checkAndRecordRequest(address _user) external returns (bool) {
        // Check global limit
        _checkGlobalLimit();
        
        // Check user-specific limit if set
        if (userLimits[_user].isActive) {
            _checkUserLimit(_user);
        }
        
        // Record the request
        _recordRequest(_user);
        _recordGlobalRequest();
        
        emit RequestAllowed(_user, userRequestCounts[_user]);
        
        return true;
    }

    // Check global limit
    function _checkGlobalLimit() internal {
        if (block.timestamp - globalWindowStart >= globalTimeWindow) {
            globalCurrentRequests = 0;
            globalWindowStart = block.timestamp;
        }
        
        require(globalCurrentRequests < globalMaxRequests, "RateLimiter: global limit exceeded");
    }

    // Check user limit
    function _checkUserLimit(address _user) internal view {
        RateLimitConfig storage config = userLimits[_user];
        
        if (block.timestamp - config.windowStart >= config.timeWindow) {
            return;
        }
        
        require(config.currentRequests < config.maxRequests, 
            "RateLimiter: user limit exceeded");
    }

    // Record request
    function _recordRequest(address _user) internal {
        RateLimitConfig storage config = userLimits[_user];
        
        if (block.timestamp - config.windowStart >= config.timeWindow) {
            config.currentRequests = 1;
            config.windowStart = block.timestamp;
        } else {
            config.currentRequests++;
        }
        
        userRequestCounts[_user]++;
        userRequestTimestamps[_user][userRequestCounts[_user]] = block.timestamp;
    }

    // Record global request
    function _recordGlobalRequest() internal {
        if (block.timestamp - globalWindowStart >= globalTimeWindow) {
            globalCurrentRequests = 1;
            globalWindowStart = block.timestamp;
        } else {
            globalCurrentRequests++;
        }
    }

    // Update global limit
    function updateGlobalLimit(uint256 _maxRequests, uint256 _timeWindow) 
        external onlyAdmin {
        require(_maxRequests > 0, "RateLimiter: invalid max requests");
        require(_timeWindow > 0, "RateLimiter: invalid time window");
        
        globalMaxRequests = _maxRequests;
        globalTimeWindow = _timeWindow;
        
        emit GlobalLimitUpdated(_maxRequests, _timeWindow);
    }

    // Get user request count
    function getUserRequestCount(address _user) external view returns (uint256) {
        return userRequestCounts[_user];
    }

    // Get user limit status
    function getUserLimitStatus(address _user) external view returns (
        uint256 currentRequests,
        uint256 maxRequests,
        uint256 timeRemaining,
        bool isActive
    ) {
        RateLimitConfig storage config = userLimits[_user];
        
        uint256 timeRemainingVal = 0;
        if (block.timestamp - config.windowStart < config.timeWindow) {
            timeRemainingVal = config.timeWindow - (block.timestamp - config.windowStart);
        }
        
        return (
            config.currentRequests,
            config.maxRequests,
            timeRemainingVal,
            config.isActive
        );
    }

    // Get global limit status
    function getGlobalLimitStatus() external view returns (
        uint256 currentRequests,
        uint256 maxRequests,
        uint256 timeRemaining
    ) {
        uint256 timeRemainingVal = 0;
        if (block.timestamp - globalWindowStart < globalTimeWindow) {
            timeRemainingVal = globalTimeWindow - (block.timestamp - globalWindowStart);
        }
        
        return (
            globalCurrentRequests,
            globalMaxRequests,
            timeRemainingVal
        );
    }

    // Check if user is rate limited
    function isRateLimited(address _user) external view returns (bool) {
        RateLimitConfig storage config = userLimits[_user];
        
        if (!config.isActive) {
            return false;
        }
        
        if (block.timestamp - config.windowStart >= config.timeWindow) {
            return false;
        }
        
        return config.currentRequests >= config.maxRequests;
    }

    // Reset user limit
    function resetUserLimit(address _user) external onlyAdmin {
        userLimits[_user].currentRequests = 0;
        userLimits[_user].windowStart = block.timestamp;
    }

    // Deactivate user limit
    function deactivateUserLimit(address _user) external onlyAdmin {
        userLimits[_user].isActive = false;
    }

    // Activate user limit
    function activateUserLimit(address _user) external onlyAdmin {
        userLimits[_user].isActive = true;
    }

    // Batch check and record
    function batchCheck(address[] calldata _users) external returns (bool[] memory) {
        bool[] memory results = new bool[](_users.length);
        
        for (uint256 i = 0; i < _users.length; i++) {
            try this.checkAndRecordRequest(_users[i]) returns (bool success) {
                results[i] = success;
            } catch {
                results[i] = false;
            }
        }
        
        return results;
    }

    // Get user timestamps
    function getUserTimestamps(address _user, uint256 _count) 
        external view returns (uint256[] memory) {
        uint256[] memory timestamps = new uint256[](_count);
        
        for (uint256 i = 1; i <= _count; i++) {
            timestamps[i - 1] = userRequestTimestamps[_user][i];
        }
        
        return timestamps;
    }

    // Get recent request count
    function getRecentRequestCount(address _user, uint256 _since) 
        external view returns (uint256) {
        uint256 count = 0;
        
        for (uint256 i = 1; i <= userRequestCounts[_user]; i++) {
            if (userRequestTimestamps[_user][i] >= _since) {
                count++;
            }
        }
        
        return count;
    }

    // Transfer admin
    function transferAdmin(address newAdmin) external onlyAdmin {
        require(newAdmin != address(0), "RateLimiter: invalid admin");
        admin = newAdmin;
    }
}

